const Landing = styled.div`
    box-shadow: -6px -6px 9px #ffffff, 6px 6px 9px rgba(0, 0, 0, 0.4);
    height: 100px;
    margin: 0 auto 20px auto;
    background-color: #c9c9c9;
`;

export default function Header() {


    return (
        <Landing></Landing>
    );
}
